import React from 'react';
import {
  Routes,
  Route,
  Outlet,
  useParams
} from "react-router-dom";

import Game from './components/game.jsx';
import GamePage from './games/gamePage.jsx'

function Games() {
  let id = useParams();
  console.log(id);
  return (
    <div>
      <br/>
      <main className="container flex flexWrap alignCenter">
        <Game name="Bones Cafe" src="bonescafe/bones_card.png"/>
      </main>

      <Routes>
        <Route path="/Games/*" element={<GamePage/>}/>
      </Routes>
    </div>
  );
}

export default Games;
